    [],nt"revision_timestamp": "2016-07-27T22:56:37.683027",nt"name": "sherburne-national-wildlife-refuge-annual-narrative-report-calendar-year-1990",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Sherburne
    NWR outlines Refuge accomplishments during the 1990 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses management planning,
    compliance with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    manpower programs, volunteer programs, funding, safety, and technical assistance
    is given. Habitat management is also covered; subjects include wetlands, forests,
    grasslands, fire management, and pest control. The wildlife section of the report
    discusses endangered and threatened species, waterfowl, marsh birds and waterbirds,
    shorebirds, game mammals, fisheries resources, and marking and bird banding. The
    public uses of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, fishing, trapping, and law enforcement. The equipment and facilities
    section of the report provides information about rehabilitation, major maintenance,
    and communication systems. Cooperative programs and items of interest are provided
    at the end. Refuge brochures and field guides are attached.",nt"license_title":
